export default class ReadonlySet<T = any> {
    protected _set: Set<T>;
    constructor(init?: T[]);
    entries(): SetIterator<[T, T]>;
    forEach(iterator: (value: T, value2: T, set: Set<T>) => void, arg?: unknown): void;
    has(value: T): boolean;
    keys(): SetIterator<T>;
    get size(): number;
    values(): SetIterator<T>;
}
